(360,	621,	1,	802,	'Dr. Jean Pierre',	'Routy',	'',	'',	'',	NULL,	NULL,	'Dr_Jean-Pierre_Routy.jpg',	'2020-07-31 16:33:41',	'Dr. Routy is the Director of the Chronic Viral Illness Service at McGill University Health Centre and is also the Director of Fonds de la Recherche en sant√© du Quebec, Sida et maladies infectieuses (FRQ-S). As an FRQ-S Clinician-Scientist, he was able to implement in 1996 the Montreal Primary HIV-Infection cohort, which generated important findings in HIV pathogenesis and Dr.ug resistance. His achievements have led Dr.. Routy to become the National Co-Director of the Immunotherapy and Vaccine Core at the Canadian Health Research Institutes for HIV Trials Network. Dr.. Routy is also a member of the HIV/AIDS Research Advisory Committee for the Federal Government of Canada.',	'Le Dr Routy est le directeur du Service des maladies virales chroniques au Centre Universitaire de Sant√© McGill et il est aussi le Directeur des Fonds de la recherche en sant√© du Qu√©bec, Sida et maladies infectieuses. En tant que scientifique-clinicien du FRQ-S, il a pu implanter en 1996 la cohorte de primo-infection VIH √† Montr√©al, ce qui a g√©n√©r√© des trouvailles importantes dans la pathog√©n√®se VIH et la r√©sistance aux m√©dicaments. Ses r√©ussites ont men√© Dr. Routy √† devenir le Co-directeur national du groupe sur l\'immunoth√©rapie et les vaccins √† l\'Institut de Recherche en sant√© du Canada pour le R√©seau Canadien pour les essais VIH. Le Dr Routy est √©galement un membre du Comit√© aviseur VIH/sida pour le gouvernement du Canada.'),
